export const Questions = [
  {
    question:"Specify your current weight:"
  },
  {
    question: "Do you have high blood pressure?",
    option1: "Yes",
    option2: "No"
  },
  {
    question: "What is your blood pressure level?",
    option1: "Normal",
    option2: "High"
  }, 
    {
      question: "Do you have a mother, father, sister, or brother with diabetes?",
      option1: "Yes",
      option2: "No",
      option3:"Not Sure",
      count: '2'
    },
    {
      question: "Have you ever been diagnosed with high blood pressure?",
      option1: "Yes",
      option2: "No"
    },
    {
      question: "Are you physically active?",
      option1: "Yes",
      option2: "No",
    },
    {
      question: "Are you a man or a woman?",
      option1: "Man",
      option2: "Woman"
    },
    {
      question: "Have you felt thirstier, or found yourself drinking more than usual in recent weeks or months?",
      option1: "Yes",
      option2: "No"
    },
  ];
